import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';

const Dashboard = () => {
  const [stats, setStats] = useState({
    totalCars: 0,
    totalMaintenance: 0,
    totalExpenses: 0,
    recentMaintenance: [],
    recentExpenses: []
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);

      // Fetch all data in parallel
      const [carsRes, maintenanceRes, expensesRes] = await Promise.all([
        axios.get('/api/cars'),
        axios.get('/api/maintenance'),
        axios.get('/api/expenses')
      ]);

      const cars = carsRes.data;
      const maintenance = maintenanceRes.data;
      const expenses = expensesRes.data;

      // Calculate total expenses
      const totalExpenses = expenses.reduce((sum, expense) => sum + expense.amount, 0);

      // Get recent maintenance (last 5)
      const recentMaintenance = maintenance
        .sort((a, b) => new Date(b.date) - new Date(a.date))
        .slice(0, 5);

      // Get recent expenses (last 5)
      const recentExpenses = expenses
        .sort((a, b) => new Date(b.date) - new Date(a.date))
        .slice(0, 5);

      setStats({
        totalCars: cars.length,
        totalMaintenance: maintenance.length,
        totalExpenses: totalExpenses,
        recentMaintenance,
        recentExpenses
      });
    } catch (error) {
      console.error('Error fetching dashboard data:', error);
      toast.error('Failed to load dashboard data');
    } finally {
      setLoading(false);
    }
  };

  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD'
    }).format(amount);
  };

  const formatDate = (date) => {
    return new Date(date).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'short',
      day: 'numeric'
    });
  };

  if (loading) {
    return (
      <div className="container mx-auto px-4 py-8">
        <div className="flex items-center justify-center min-h-64">
          <div className="spinner"></div>
        </div>
      </div>
    );
  }

  return (
    <div className="container mx-auto px-4 py-8">
      {/* Header */}
      <div className="mb-12 text-center">
        <h1 className="text-5xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent mb-4">
          Welcome to CarVault
        </h1>
        <p className="text-xl text-gray-600 max-w-2xl mx-auto">
          Your personal car collection manager. Track maintenance, expenses, and keep your vehicles in perfect condition.
        </p>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-12">
        <div className="card group hover:scale-105 transition-transform duration-300">
          <div className="card-body">
            <div className="flex items-center">
              <div className="p-4 bg-gradient-to-br from-blue-500 to-blue-600 rounded-2xl shadow-lg group-hover:shadow-xl transition-shadow">
                <span className="text-3xl">🚗</span>
              </div>
              <div className="ml-6">
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Total Cars</p>
                <p className="text-4xl font-bold text-gray-900 mt-1">{stats.totalCars}</p>
              </div>
            </div>
          </div>
        </div>

        <div className="card group hover:scale-105 transition-transform duration-300">
          <div className="card-body">
            <div className="flex items-center">
              <div className="p-4 bg-gradient-to-br from-green-500 to-green-600 rounded-2xl shadow-lg group-hover:shadow-xl transition-shadow">
                <span className="text-3xl">🔧</span>
              </div>
              <div className="ml-6">
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Maintenance Records</p>
                <p className="text-4xl font-bold text-gray-900 mt-1">{stats.totalMaintenance}</p>
              </div>
            </div>
          </div>
        </div>

        <div className="card group hover:scale-105 transition-transform duration-300">
          <div className="card-body">
            <div className="flex items-center">
              <div className="p-4 bg-gradient-to-br from-yellow-500 to-orange-500 rounded-2xl shadow-lg group-hover:shadow-xl transition-shadow">
                <span className="text-3xl">💰</span>
              </div>
              <div className="ml-6">
                <p className="text-sm font-semibold text-gray-600 uppercase tracking-wide">Total Expenses</p>
                <p className="text-4xl font-bold text-gray-900 mt-1">{formatCurrency(stats.totalExpenses)}</p>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-12">
        <Link
          to="/cars/add"
          className="card group hover:scale-105 transition-all duration-300 cursor-pointer bg-gradient-to-br from-blue-50 to-indigo-50 border-2 border-blue-100 hover:border-blue-300"
        >
          <div className="card-body text-center">
            <div className="text-5xl mb-4 group-hover:scale-110 transition-transform duration-300">🚗</div>
            <h3 className="font-bold text-gray-900 text-lg mb-2">Add Car</h3>
            <p className="text-sm text-gray-600">Register a new vehicle to your collection</p>
          </div>
        </Link>

        <Link
          to="/maintenance/add"
          className="card group hover:scale-105 transition-all duration-300 cursor-pointer bg-gradient-to-br from-green-50 to-emerald-50 border-2 border-green-100 hover:border-green-300"
        >
          <div className="card-body text-center">
            <div className="text-5xl mb-4 group-hover:scale-110 transition-transform duration-300">🔧</div>
            <h3 className="font-bold text-gray-900 text-lg mb-2">Log Maintenance</h3>
            <p className="text-sm text-gray-600">Record service history and repairs</p>
          </div>
        </Link>

        <Link
          to="/expenses/add"
          className="card group hover:scale-105 transition-all duration-300 cursor-pointer bg-gradient-to-br from-yellow-50 to-orange-50 border-2 border-yellow-100 hover:border-yellow-300"
        >
          <div className="card-body text-center">
            <div className="text-5xl mb-4 group-hover:scale-110 transition-transform duration-300">💰</div>
            <h3 className="font-bold text-gray-900 text-lg mb-2">Add Expense</h3>
            <p className="text-sm text-gray-600">Track fuel, insurance, and costs</p>
          </div>
        </Link>

        <Link
          to="/cars"
          className="card group hover:scale-105 transition-all duration-300 cursor-pointer bg-gradient-to-br from-purple-50 to-pink-50 border-2 border-purple-100 hover:border-purple-300"
        >
          <div className="card-body text-center">
            <div className="text-5xl mb-4 group-hover:scale-110 transition-transform duration-300">📋</div>
            <h3 className="font-bold text-gray-900 text-lg mb-2">View All Cars</h3>
            <p className="text-sm text-gray-600">Manage your entire collection</p>
          </div>
        </Link>
      </div>

      {/* Recent Activity */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Recent Maintenance */}
        <div className="card">
          <div className="card-header">
            <h3 className="text-lg font-semibold text-gray-900">Recent Maintenance</h3>
            <Link to="/maintenance" className="text-sm text-blue-600 hover:text-blue-500">
              View all
            </Link>
          </div>
          <div className="card-body">
            {stats.recentMaintenance.length === 0 ? (
              <div className="empty-state">
                <div className="empty-state-icon">🔧</div>
                <p>No maintenance records yet</p>
                <Link to="/maintenance/add" className="btn btn-primary btn-sm mt-4">
                  Add Maintenance
                </Link>
              </div>
            ) : (
              <div className="space-y-3">
                {stats.recentMaintenance.map((record) => (
                  <div key={record._id} className="flex items-center justify-between py-2 border-b border-gray-100 last:border-b-0">
                    <div>
                      <p className="font-medium text-gray-900">{record.type}</p>
                      <p className="text-sm text-gray-600">{record.car?.make} {record.car?.model}</p>
                    </div>
                    <div className="text-right">
                      <p className="font-medium text-gray-900">{formatCurrency(record.cost)}</p>
                      <p className="text-sm text-gray-600">{formatDate(record.date)}</p>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>

        {/* Recent Expenses */}
        <div className="card">
          <div className="card-header">
            <h3 className="text-lg font-semibold text-gray-900">Recent Expenses</h3>
            <Link to="/expenses" className="text-sm text-blue-600 hover:text-blue-500">
              View all
            </Link>
          </div>
          <div className="card-body">
            {stats.recentExpenses.length === 0 ? (
              <div className="empty-state">
                <div className="empty-state-icon">💰</div>
                <p>No expenses recorded yet</p>
                <Link to="/expenses/add" className="btn btn-primary btn-sm mt-4">
                  Add Expense
                </Link>
              </div>
            ) : (
              <div className="space-y-3">
                {stats.recentExpenses.map((expense) => (
                  <div key={expense._id} className="flex items-center justify-between py-2 border-b border-gray-100 last:border-b-0">
                    <div>
                      <p className="font-medium text-gray-900">{expense.category}</p>
                      <p className="text-sm text-gray-600">{expense.car?.make} {expense.car?.model}</p>
                    </div>
                    <div className="text-right">
                      <p className="font-medium text-gray-900">{formatCurrency(expense.amount)}</p>
                      <p className="text-sm text-gray-600">{formatDate(expense.date)}</p>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
